// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FileRegistry {
    struct FileRecord {
        string fileHash;
        address uploader;
        uint timestamp;
    }

    mapping(string => FileRecord) public files;

    event FileUploaded(string fileHash, address indexed uploader, uint timestamp);

    function uploadFile(string memory _fileHash) public {
        require(bytes(_fileHash).length > 0, "Hash cannot be empty");
        require(files[_fileHash].timestamp == 0, "File already exists");

        files[_fileHash] = FileRecord({
            fileHash: _fileHash,
            uploader: msg.sender,
            timestamp: block.timestamp
        });

        emit FileUploaded(_fileHash, msg.sender, block.timestamp);
    }

    function verifyFile(string memory _fileHash) public view returns (address, uint) {
        require(files[_fileHash].timestamp != 0, "File not found");
        FileRecord memory file = files[_fileHash];
        return (file.uploader, file.timestamp);
    }
}
